            avatar_url: 'https://avatars0.githubusercontent.com/u/1?v=4',
            html_url: 'https://github.com/mojombo'
        }
    }

    render() {
        return (
            <div className='card text-center'>
                {console.log(this.state)}
                <img
                    src={this.state.avatar_url}
                    alt=''
                    className='round-img'
                    style={{ width: '60px' }}
                />
            </div>
        );
    }
}

export default UserItem
